(22, 'Computer Engineering', '7', 'A', 'The mid semester submissions are too stressful'),
(23, 'Computer Engineering', '7', 'A', 'The department is not at all student friendly. There is hardly any relation between student and teachers. The department also does not give any opportunity for  exploring new ventures or challenges. Most of the teachers don\'t have time to take care of student\'s time. The department should strongly start thinking about students as a whole.'),
