(25, 'Computer Engineering', '7', 'A', 'The first mid-term test could be  held earlier so as to have sufficient time between the two mid-term tests. Usually it gets super hectic after the first mid-term owing to submissions, practicals and the mid-term test two approaching.'),
(26, 'Computer Engineering', '7', 'A', 'Fans not working properly . No proper ventilation. Sometimes the level of suffocation goes above the level of patience. Toilets are not cleaned daily. Fans should be proper in each class.'),
(27, 'Computer Engineering', '7', 'A', '--'),
