(29, 'Computer Engineering', '7', 'A', 'Very little attention drawn towards practical knowledge for students. Hardly any opportunity towards the fundamental or industrial growth for the students. Resources like the computers and the internet facilities MUST be improved for the departments and especially for the computer department.  '),
(30, 'Computer Engineering', '7', 'A', 'An overall good college to study and the faculty of comps is extremely good towards students just a bit of delay in submissions.'),
