INSERT INTO `feedback_inst_temp` (`fi_temp_id`, `dept`, `sem`, `div_id`, `comment`) VALUES
(477, 'Mechanical Engineering', '7', 'B', 'In practical there is no such lab where we can actually perform the experiments. Not a single computer works in labs. No facilities are provided to us hence after paying such a huge amount of fees. No seriousness towards the practical learning. No proper software available. Many classrooms and not properly maintained. No proper projector in classes. Drinking water is the worst, We have to fill water from outside or purchase from canteen. When we pay such a huge amount so we at least expect to get some basic facilities like proper drinking water, clean toilet, Proper classrooms, Working computers, cad, cam software, proper maintained Practical labs. Rest all things are good. '),
(478, 'Electronics and Telecommunication', '5', 'A', 'lab maintance is not proper, pc\'s are not working, No fresh water and yeah we need ac'),
(479, 'Electronics and Telecommunication', '5', 'A', 'washroom water issue. computers in lab are not working,'),
(480, 'Electronics and Telecommunication', '5', 'A', 'Although faculty is good ,With lack of good and working lab equipments. The college has been highly ignorant about the infrastructure and equipments available to student. The college spirit is killed then and there.\r\ninfrastructure also lacks cleanliness. No purified water is available .\r\nThe college is not at all responsive about the needs of the student .\r\nalthough complaining hundreds of time nothing is considered or acted upon.  \r\nNo regards for the pressure put on the students  during the final weeks .\r\n'),
(481, 'Electronics and Telecommunication', '5', 'A', 'Poor facilities such as bad washrooms,no water facility,poor infrastructure,Aged tools and equipment,No computers working in labs.'),
(482, 'Electronics and Telecommunication', '5', 'A', 'Fix bathroom,add ACs,cleanliness could be better,no computer working in computer lab.'),
(483, 'Electronics and Telecommunication', '5', 'A', 'classes ,washrooms are not clean.\r\nno water facility in washrooms\r\nonly 2 computers work out of 25 computers\r\n\r\n'),
(484, 'Electronics and Telecommunication', '5', 'A', 'Less equipments , no proper washroom facility. Provide sufficient amount of computers so that students can have a good experience and perform their practical well.'),
(485, 'Electronics and Telecommunication', '5', 'A', 'No good hygienic facility,no water facility,bad quality of drinking water,no action is taken after many complaints,no sports ground or no physical activity conducted by college '),
(486, 'Mechanical Engineering', '7', 'B', 'more placements are needed in mechanical engineering. '),
(487, 'Electronics and Telecommunication', '5', 'A', '1. motivate students for various competitions and provide facilities.\r\n2. poor infrastructure and less electronic equipments in practicals which leads in  decreasing our practical knowledge.\r\n3. provide appropriate schedulde for project work. \r\n4. toilets and water facilities should be improved.\r\n5. lack of teaching skills in some faculties.\r\n6. should provide us an internship which will helps us in building a good cv .'),
(488, 'Mechanical Engineering', '7', 'B', 'The institute doesn\'t provide safe drinking water and hygienic restrooms. Institute should also support different teams and committees working in the different fields of engineering. The knowledge they gain from those stuff is much more important than the outdated knowledge they are gaining in lecture. '),
(489, 'Electronics and Telecommunication', '5', 'A', 'Washrooms are PATHETIC. Doesnt feel like we are in a college in mumbai versova. The attitude of most of the staff and peons is not satisfactory. They have alot of attitude. Computers dont work at all. ALSO THESE FEEDBACKS WONT BE LOOKED UPON TO'),
(490, 'Mechanical Engineering', '7', 'B', 'The washrooms aren\'t maintained properly at all ! Hygiene is a very important aspect of life and it should be given the highest priority. The working student bodies in the institute should be provided with moral and financial support as they represent the institute in various national and international level programs and competitions. '),
(491, 'Electronics and Telecommunication', '5', 'A', '1.washrooms are inadequate\r\n2.no mirrors in any washroom of the college\r\n3.less availability of latest books in library\r\n4.lack of computers in library\r\n5.no internet connections\r\n6.we have to give our own internet connection for use\r\n7.In some class room fans are not working, and after complaining it to HOD he is like \"you should write a letter to me about this \"\r\n8.In labs most of the COMPUTERS  (APPROXIMATELY 8/10) are not in working conditions.\r\n9.no proper supply of water\r\naur wo railway concession wale ko kis baat ki akad hai pata nahi\r\nprincipal se jyada akad mai toh wo rehta hai............'),
(492, 'Electronics and Telecommunication', '5', 'A', 'Toilets aren\'t clean and at times there is no water supply. Lack of computer instruments in the lab which makes it difficult for the students to get the practical knowledge of the softwares which are being used. Administration, accounts and examination cell staffs are very rude and not helpful at times.  '),
(493, 'Mechanical Engineering', '7', 'B', '--'),
(494, 'Electronics and Telecommunication', '5', 'B', 'fans are not working properly,computer in the labs are not working,lab assistants of few labs should behave properly'),
(495, 'Electronics and Telecommunication', '5', 'B', 'please instruct the faculty inform the students regarding the presentations,mini projects,etc work at the beginning to the sem as it becomes a burden on the students to cope with all these stuffs collectively at the end'),
(496, 'Electronics and Telecommunication', '5', 'B', 'journals and assignments should be given before so that the exams and submissions would not collapse so as to get ample amount of time for self study and also the laboratory equipment should be provided sufficiently.'),
(497, 'Electronics and Telecommunication', '5', 'B', 'I think the  practical materials should be provided.'),
(498, 'Electronics and Telecommunication', '5', 'B', 'AVERAGE\r\n'),
(499, 'Electronics and Telecommunication', '5', 'B', 'How do you all expect us to to do practicals when there are only 3-4 PC\'s of the total PC\'s working in Signal processing and MES lab?'),
(500, 'Electronics and Telecommunication', '5', 'B', '--'),
(501, 'Electronics and Telecommunication', '5', 'B', 'Practical knowledge should be provided more.Infrastructure problem.should be more concentrated on real time projects.'),
(502, 'Electronics and Telecommunication', '5', 'B', 'Please install AC\'s in the classrooms, the class strength is 75. Please buy new PC\'s for all the labs as everyone of them is obsolete and all of them have stopped working and our work is delayed. Please clean the washrooms more frequently and PLEASE PUT PARTITIONS BETWEEN THE URINALS.'),
(503, 'Electronics and Telecommunication', '5', 'B', 'most of the computers in labs are not working. washrooms are not clean'),
(504, 'Electronics and Telecommunication', '5', 'B', 'need basic facilties indeed in a institution\r\n-proper working PC\'s, better CRO\'s\r\n-clean washrooms\r\n-better ventilation in labs as well as classroom\r\n'),
(505, 'Electronics and Telecommunication', '5', 'B', 'practical is something very crucial. but in out institue for performing practicaly hardly there is one or two pc works between 30students and institute is not paying attention to this problem. also mini project and lot of assignment are bombared at the end of semester which puts pressure on students and due to which we get less time for studying so all this works should be given before hand so there is no last moment burden.'),
(506, 'Electronics and Telecommunication', '5', 'B', 'majority computers do not work in the labs which causes difficulties in performing. fans do not work. '),
(507, 'Electronics and Telecommunication', '5', 'B', 'very good'),
