(552, 'Electronics and Telecommunication', '3', 'B', 'Poor infrastructure. poor supply of water sometimes there is no water available for drinking as well as in the washrooms which can be dangerous to the health of the student . No ACs in the lab. Not  Sufficient  PCs . LIfts are no working etc etc....... '),
